import React from 'react';
import './App.css';
import Footer from './Footer'
import MainContent from './MainContent';
import Header from './Header';
import logo from './logo.svg';

function App() {
  const date = new Date();

  return (
    <div>     
      <Header />
      <h3>It is currently about { date.getHours() % 12 } o' clock</h3>
      <MainContent />
      <Footer />
    </div> 
  );
}

export default App;
